import Meta from "./Meta";
import Header from "./Header";
import Footer from "./Footer";

const Layout = props => (
  <>
    <Meta />
    <div className="main-container">
      <Header />
      <main className="wrapper">{props.children}</main>
      <Footer />
    </div>
    <style jsx>{`
      .main-container {
        height: 100%;
        display: flex;
        flex-direction: column;
      }

      main {
        flex: 1;
        background: white;
        border-radius: 5px;
      }
    `}</style>
  </>
);

export default Layout;
